          if(userInfo?.name == cart[i].userName){
            len = len + 1
          }
        }
        setLen(len)
      }

      setLength();

    },);
      
    


    return(
        <Navbar bg="dark" expand="lg" variant="dark">
        

        <div id='hdLogo'> 
                <img alt="Logo"  src={require("../images/Cafe.png")} width="90"  height="55" className="d-inline-block align-top" /> 
            </div>

          <Navbar.Brand>
          <Link to='/customer-home' className='homenavbar-logo'>
                  Cafe SecretAlly
          </Link>
          </Navbar.Brand>
  
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            
          <Nav className="m-auto">
            <Form inline>
              
            </Form>
          </Nav>
  
        
              <Nav>
                {" "}
                <Nav.Link>
                <Link to='/customer-home' className='homenav-links'>
                          Home
                      </Link>
                </Nav.Link>
  
                <Nav.Link>
                  <Link to='/contact' className='homenav-links'>
                          Contact Us
                  </Link>
                </Nav.Link>

                <Nav.Link href="/cart">
                  
                                  <FaShoppingCart/> Cart <span className='circle' style={{position: 'absolute', top: '15px'}}></span>
                  
                </Nav.Link>
  
                
              </Nav>
              
            
             
           
          </Navbar.Collapse>
      </Navbar>
    );
}

export default HomeNavBar;
